        <script>
            var swiper = new Swiper('.swiper-container', {
                pagination: '.swiper-pagination',
                paginationClickable: true,
                autoplay: 8000,
                loop: true
            });

            function quick_btn(idx) {
                if (idx == 1) {
                    menu_open('login');
                    setTimeout(function () {
                        slide_toggle('cash_in');
                    }, 600);
                }
                if (idx == 2) {
                    menu_open('login');
                    setTimeout(function () {
                        slide_toggle('cash_out');
                    }, 600);
                }
                if (idx == 3) {
                    menu_open('login');
                    setTimeout(function () {
                        slide_toggle('point_exchange');
                    }, 600);
                }
            }
        </script>

        <script>
            $('.notice_close').on('click', function () {
                $('#m_menuWrap').css('top', '55px');
                $('#m2_menuWrap').css('top', '55px');
                $('#sub_wrap').css('margin-top', '55px');
                $('#contents').css('margin-top', '55px');
                $('.notice').remove();
            });
            $(".livecasino > dd > span").click(function () {
                if ($(this).parent().hasClass('on')) {
                    $(this).parent().removeClass('on');
                    if ($(this).parent().next().is("dt")) {
                        $(this).parent().next().stop().slideUp();
                    }
                } else {
                    $(this).parent().addClass('on');
                    if ($(this).parent().next().is("dt")) {
                        $(this).parent().next().stop().slideDown(function () {
                            $(".m-menu_list_view > dl").css({"height": "auto"});
                            iScrollRefresh();
                        });
                    }sd
                }
            });

            var lastScrollTop = 0;
            $(window).scroll(function () {
                st = $(this).scrollTop();
                if (st < lastScrollTop) {
                    $('#header').removeClass('hidden');
                } else if (st > lastScrollTop && lastScrollTop > 240) {
                    $('#header').addClass('hidden');
                }
                lastScrollTop = st;
            });
        </script>



